sub redcheck{

        my @x,@y,@z;
        my $dd = shift;
        $x[0]=shift; $x[1]=shift;
        $y[0]=shift; $y[1]=shift;
        $z[0]=shift; $z[1]=shift;
	my $bw = shift;
        my $max=-1;
        my $maxnum=-1;
        my @ctr;

        foreach $i(0...$#sp){
                if($sp[$i][1]==0){
                        my $count=0;
                        @ctr = split(" ",$sp[$i][0]);
                        foreach $j(0...$#sp){
                                @pt=split(" ",$sp[$j][0]);
                                if(($sp[$j][1]==0)&&(($pt[0]-$ctr[0]<$x[0])&&($pt[0]-$ctr[0]>$x[1]))&&(($pt[1]-$ctr[1]<$y[0])&&($pt[1]-$ctr[1]>$y[1]))&&(($pt[2]-$ctr[2]<$z[0])&&($pt[2]-$ctr[2]>$z[1])))
                                {
                                        $count++;
                                }
                        }
                        if($count>$max){
                                $max=$count;
                                $maxnum=$i;
                        }
                }
        }
        if($maxnum == -1){
                return 0;
        }
        else{
                push(@ans,$sp[$maxnum][0]);
                bomb($sp[$maxnum][0],$dd,$x[0],$x[1],$y[0],$y[1],$z[0],$z[1],$bw);
                return 1;
        }






}


sub pushans{

        my $bn = shift;
        my $lr = shift;
        my $alpha = shift;
        #my $l = $lr*$alpha + 7.5;
        my $l = $lr*$alpha;

        foreach $pt(0...$#ans){
                my @t = split(" ",$ans[$pt]);
                my $db = 0;
                my $min = 9999;
                my @sum;
				my $uv;
				$sum[0][0] = 0; $sum[0][1] = 0; $sum[0][2] = 0;
                for(my $i=0;$i<$bn;$i++){
						$min = 9999;
						foreach(@bp){
							my @tt = split(" ",$_);
							my $dt = (($t[0]-$tt[0])**2+($t[1]-$tt[1])**2+($t[2]-$tt[2])**2)**0.5;
							if( $dt<$min && $dt>$db ){
								$min = $dt;
								$sum[1][0] = $tt[0]; $sum[1][1] = $tt[1]; $sum[1][2] = $tt[2];
							}
						}
						$db = $min;
						$sum[0][0] = $sum[0][0] + $sum[1][0]; 
						$sum[0][1] = $sum[0][1] + $sum[1][1]; 
						$sum[0][2] = $sum[0][2] + $sum[1][2]; 
                }
				$sum[0][0] = $sum[0][0]/$bn; $sum[0][1] = $sum[0][1]/$bn; $sum[0][2] = $sum[0][2]/$bn;
				$sum[0][0] = $t[0]-$sum[0][0]; 
				$sum[0][1] = $t[1]-$sum[0][1]; 
				$sum[0][2] = $t[2]-$sum[0][2];
				$uv = ($sum[0][0]**2+$sum[0][1]**2+$sum[0][2]**2)**0.5;
				$sum[0][0] = $t[0]+($sum[0][0]/$uv)*$l; 
				$sum[0][1] = $t[1]+($sum[0][1]/$uv)*$l; 
				$sum[0][2] = $t[2]+($sum[0][2]/$uv)*$l;
				$ans[$pt] = "$sum[0][0] $sum[0][1] $sum[0][2]";
        }

}


















